import React from "react";
import { Link } from "react-router-dom";

const Finished = () =>  {
    return (
        <div>
            <h1>검사가 완료되었습니다</h1>
            <h2>결과는 상대적으로 ...</h2>
            <Link to='/finished'>
                <button>결과 보기</button>
            </Link>
        </div>
    )
}

export default Finished
